    [RequireComponent(typeof(ParticleSystem))]
    public class PointCloudVisualizer : MonoBehaviour
    {
        private ParticleSystem _particleSystem;

        public Color Color = Color.yellow;
        public float Size = 0.25f;
        
        private ParticleSystem.Particle[] _particles;

        private void Awake()
        {
            _particleSystem = GetComponent<ParticleSystem>();
            // LoadSampleData();
        }

        private void LoadSampleData()
        {
            var sampleParticleData = _sampleData.Split(',').Select(s => float.Parse(s)).ToArray();
            SetParticles(sampleParticleData);
            transform.localPosition = Camera.main.transform.position;
            transform.localRotation = Camera.main.transform.rotation;
        }

        public void SetParticles(float[] pointCloud)
        {
            var size = pointCloud.Length / 3;
            Array.Resize(ref _particles, size);
            
            for (int i = 0; i < size; i++)
            {
                var particle = _particles[i];
                var xIndex = i * 3;
                particle.position = new Vector3(pointCloud[xIndex], pointCloud[xIndex + 1], pointCloud[xIndex + 2]);
                particle.startColor = Color;
                particle.startSize = Size;

                _particles[i] = particle;
            }
            
            _particleSystem.SetParticles(_particles);
        }

